    false,nt"url": null,nt"notes": "This is an Arc/Info coverage consisting
    of one arc representing the historic retaining wall (HS-X2) at Pipe Spring National
    Monument, Arizona. The retaining wall was collected by a Trimble GeoXT GPS unit
    with external antenna, Hurricane, and post processed in GPS Pathfinder Office 3.0
    for differential corrections. This feature is referenced by the 2000 National Register
    of Historic Places, Nomination Update (August 14, 2000). Located on the map: Pipe
    Spring National Monument Historic District (prepared by: Kathy McKoy, NPS, June
    2000 detail; revised Existing Conditions map, Landscape Systems, 1997). It is a
    contributing feature.",nt"license_title": null,nt"extras": [{ntt"key":
